import React, { useState } from 'react';
import { Resizable } from 'react-resizable';

import './App.css';

const App = () => {
  const [widths, setWidths] = useState([200, 200, 200]);

  const onResize = (index, e, { size }) => {
    const newWidths = [...widths];
    newWidths[index] = size.width;
    setWidths(newWidths);
  };

  return ( 
    <>
<div className="container">
      <ResizableBox
        className="component"
        width={sizes[0]}
        height={200}
        resizeHandles={['e', 'w']}
        onResize={(event, { size }) => onResize(0, event, { size })}
      >
        <div>
          <h2>Component 1</h2>
          <p>This is some content for Component 1.</p>
          <img src="https://media.gettyimages.com/id/1335295270/photo/global-connection.jpg?s=612x612&w=gi&k=20&c=xs_DvcvEflA-EIRXXGK71Et6OtVHldTx2E7flyjybk0=" alt="Image 1" />
        </div>
      </ResizableBox>
      <ResizableBox
        className="component"
        width={sizes[1]}
        height={200}
        resizeHandles={['e', 'w']}
        onResize={(event, { size }) => onResize(1, event, { size })}
      >

        <div>
          <h2>Component 2</h2>
          <p>This is some content for Component 2.</p>
          <img src="https://media.gettyimages.com/id/1335295270/photo/global-connection.jpg?s=612x612&w=gi&k=20&c=xs_DvcvEflA-EIRXXGK71Et6OtVHldTx2E7flyjybk0=" alt="Image 2" />
        </div>
      </ResizableBox>

      <ResizableBox
        className="component"
        width={sizes[2]}
        height={200}
        resizeHandles={['e', 'w']}
        onResize={(event, { size }) => onResize(2, event, { size })}
      >
      <br/> <br/>
        <div>
          <h2>Component 3</h2>
          <p>This is some content for Component 3.</p>
          <img src="https://media.gettyimages.com/id/1335295270/photo/global-connection.jpg?s=612x612&w=gi&k=20&c=xs_DvcvEflA-EIRXXGK71Et6OtVHldTx2E7flyjybk0=" alt="Image 3" />
        </div>
      </ResizableBox>
    </div>
    </>
   );
}

export default App;
